import axios from "axios";

export default function SignUp() {
    const logout = () => {
        axios.get("/logout").then((resp) => {
            console.log(resp);
        })
    }

    return (
        <main style={{ padding: "1rem 0" }}>
            <h2>SignUp</h2>
            <button onClick={logout}>Logout</button>
        </main>
    );
}
